        #region Session Values

        private int UserId
        {
            get
            {
                var securityUserId = 0;

                if (HttpContext.Session.Keys.Any(a => a.Equals("UserId")))
                {
                    securityUserId = HttpContext.Session.GetInt32("UserId") ?? 0;
                }

                return securityUserId;
            }
            set {; }
        }
        private string UserName
        {
            get
            {
                var securityUserName = "";

                if (HttpContext != null && HttpContext.Session.Keys.Any(a => a.Equals("UserName")))
                {
                    securityUserName = HttpContext.Session.GetString("UserName");
                }

                return securityUserName;
            }
            set {; }
        }

        #endregion
        #region Default Documents

        [HttpGet]
        [Route("GetAllDefaultDocuments")]
        public DataSourceResult GetAllDefaultDocuments([DataSourceRequest]DataSourceRequest request)
        {
            try
            {
                return _mdDocumentRepository.GetAllDefaultDocuments().ToDataSourceResult(request);
            }
            catch (Exception ex)
            {
                LogException.Log(ex, this.ControllerContext);
                throw new Exception(ex.ToString());
            }
        }

        [HttpGet]
        [Route("GetDocumentsByCategoryId")]
        public IActionResult GetDocumentsByCategoryId(int id)
        {
            try
            {
                var retVal = _mdDocumentRepository.GetDocumentsByCategoryId(id);
                return Ok(retVal);
            }
            catch (Exception ex)
            {
                LogException.Log(ex, this.ControllerContext);
                throw new Exception(ex.ToString());
            }
        }

        [HttpGet]
        [Route("DeleteDocumentById")]
        [HistoryFilter]
        public IActionResult DeleteDocumentById(int id)
        {
            try
            {
                var retVal = _mdDocumentRepository.DeleteDefaultDocumentById(id, UserId, UserName);
                return Ok(retVal);
            }
            catch (Exception ex)
            {
                LogException.Log(ex, this.ControllerContext);
                throw new Exception(ex.ToString());
            }
        }

        [HttpPost]
        [Route("UploadDefaultDocumentsAjax")]
        public bool UploadDefaultDocumentsAjax()
        {
            try
            {
                DefaultDocument document = JsonConvert.DeserializeObject<DefaultDocument>(Request.Form["documentData"]);

                long uploaded_size;
                int iCounter;
                string sFiles_uploaded;

                /// method call to upload document.
                var documents = _document.Upload(document, Convert.ToInt32(document.DefaultDoc_Id_Category), Request, out uploaded_size, out iCounter, out sFiles_uploaded);

                foreach (var doc in documents)
                {
                    document.document_file_extension = doc.document_file_extension;
                    document.document_mime_type = doc.document_mime_type;
                    document.document_object = doc.document_object;
                    document.document_size = doc.document_size;
                    document.DefaultDoc_Name = doc.document_file_name;
                    document.DefaultDoc_CreatedByUserId = UserId;
                    document.DefaultDoc_CreatedByUserName = UserName;
                    document.DefaultDoc_UpdatedByUserId = UserId;
                    document.DefaultDoc_UpdatedByUserName = UserName;
                    _mdDocumentRepository.InsertUpdateDefaultDocumentRecord(document);
                }


                string message = "Upload successful!\n files uploaded:" + iCounter + "\nsize:" + uploaded_size + "\n" + sFiles_uploaded;
                return true;
            }
            catch (Exception ex)
            {
                LogException.Log(ex, this.ControllerContext);
                throw new Exception(ex.ToString());
            }
        }

        [Route("DownloadFile")]
        [HistoryFilter]
        public IActionResult DownloadFile(int document_Id)
        {
            try
            {
                byte[] bytes;
                string fileName, contentType;
                var result = _document.DownloadFile(document_Id, 2);
                bytes = result.document_object;
                contentType = result.document_mime_type;
                fileName = result.document_file_name;
                return File(bytes, contentType, fileName);
            }
            catch (Exception ex)
            {
                LogException.Log(ex, this.ControllerContext);
                throw new Exception(ex.ToString());
            }
        }

        private string GetContentType(string path)
        {
            var types = GetMimeTypes();
            var ext = Path.GetExtension(path).ToLowerInvariant();
            return types[ext];
        }

        private Dictionary<string, string> GetMimeTypes()
        {
            return new Dictionary<string, string>
            {
                {".txt", "text/plain"},
                {".pdf", "application/pdf"},
                {".doc", "application/vnd.ms-word"},
                {".docx", "application/vnd.ms-word"},
                {".xls", "application/vnd.ms-excel"},
                {".xlsx", "application/vnd.openxmlformats-officedocument.spreadsheetml.sheet"},
                {".png", "image/png"},
                {".jpg", "image/jpeg"},
                {".jpeg", "image/jpeg"},
                {".gif", "image/gif"},
                {".csv", "text/csv"}
            };
        }

