                var uploaded_files = Request.Form.Files;

                foreach (var document in documentsList)
                {
                    var uploaded_file = uploaded_files.FirstOrDefault(u => u.Name == document.DefaultDoc_Name);

                    if (uploaded_file != null)
                    {
                        long Size = uploaded_file.Length;
                        string Extension = Path.GetExtension(uploaded_file.FileName);
                        string FileName = Path.GetFileName(uploaded_file.FileName);
                        string fileNameToSave = Guid.NewGuid().ToString() + Extension;

                        string targetPath = "C:\\MediaFiles\\" + 5 + "\\" + document.DefaultDoc_Id_Category + "\\";

                        string new_Filename_on_Server = targetPath + "\\" + fileNameToSave;

                        if (!Directory.Exists(targetPath))
                        {
                            System.IO.Directory.CreateDirectory(targetPath);
                        }
                        //uploaded_file.
                        using (FileStream stream = new FileStream(new_Filename_on_Server, FileMode.Create))
                        {
